import Logo from "../../Logo-white.png";
//import 'bootstrap/dist/css/bootstrap.min.css';
import Card from '../Card'

const App =()=>{
  return (
    <div>
    <Navbar
    color="light"
    expand="md"
    light
  >
    <NavbarBrand href="/">
      reactstrap
    </NavbarBrand>
   {/* <NavbarToggler onClick={function noRefCheck(){}} /> */}
      </Navbar>
    <main>
    <Card/>
    </main>
  </div>
    
  );
  }

export default App;
